	# =======================
	#region Initialization
	$formSimulation_Load = {
		# ==================================
		#region Event Variables
		# ==================================
		
		# Configuration Variables
		# ==================================
		[string]$global:TracePath = ".\Mjolnir.trace"
		[string]$MathNetPath = ".\MathNet.Numerics.dll"
		[string]$global:TruckSoundPath = ".\TruckSound.wav"
		[string]$global:HTMLPath = ""
		[String]$global:MjolnirConfigPath = ".\MjolnirConfig.Export.ps1"
		$global:TruckSound = $null
		
		# Assemblies
		# =================================
		[System.Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms")
		Add-Type -Path $MathNetPath
		
		# User Variables
		# ==================================
		[int]$global:LeadTime 				= 0
		[double]$global:StandardDeviation 	= 30.0
		[int]$global:ChangeProdLevel 		= 0
		
		# Simulation Variables
		# ========================================
		[double]$global:RandomNumber 	= Get-RandNum
		[int]$global:Week 				= 1 # Start at time = 1.
		[int]$global:InitialInventory 	= 450
		[int]$global:CurrentProduction 	= 70
		[int]$global:Demand 			= Get-InverseNorm -mu 100.0 -sigma $global:StandardDeviation -some_prob $global:RandomNumber
		[int]$global:ChangeThisWeek 	= 0
		[int]$global:Shortage 			= 0
		[int]$global:CompanyStorage 	= 240
		[int]$global:PublicStorage 		= 0
		[double]$global:TotalThisWeek 	= 0.00
		[double]$global:TotalAmount 	= 0.00
		[int]$global:EndingInventory 	= ($global:InitialInventory + $global:CurrentProduction - $global:Demand)
		
		[double]$global:TotalThisWeekBuffer = 0.00
		[double]$global:TotalAmountBuffer 	= 0.00
		[double]$global:StdDevBuffer		= 0.00
		[string]$global:SoftwareVersion		= 1.3
		[int]$global:CurrentProdBuffer 		= 70.0
		
		# Shared variables?
		# -----------------
		#[int]$global:VacationWeek 	= 0
		#[int]$global:VacationWeek2 	= 0
		#endregion
		# ==================================
		
		# ==================================
		#region Event Logic
		# ==================================
		
		Calculate-Storage
		
		$lvIndex = $global:Week - 1
		
		$lvSim.Items.Add($global:RandomNumber)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:Week)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:InitialInventory)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:CurrentProduction)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:Demand)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:StandardDeviation)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:LeadTime)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:ChangeProdLevel)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:ChangeThisWeek)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:EndingInventory)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:Shortage)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:CompanyStorage)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:PublicStorage)
		$lvSim.Items.Item($lvIndex).SubItems.Add($global:TotalThisWeek)
		
		Calculate-Week
		
		# Load Animation
		# ---------------------
		Load-Animation
		
		#endregion
		# ==================================
	}
